from typing import List, Tuple
from functools import lru_cache
class Solution:
    @lru_cache(None)
    def func(self, pos: Tuple[int, int]) -> List[Tuple[int, int]]:
        x, y = pos
        if self.obstacleGrid[x][y]: return []
        if x + 1 == len(self.obstacleGrid) and y + 1 == len(self.obstacleGrid[0]):
            return [pos]
        if x + 1 < len(self.obstacleGrid):
            candi = self.func((x + 1, y))
            if candi:
                candi.append(pos)
                return candi
        if y + 1 < len(self.obstacleGrid[0]):
            candi = self.func((x, y + 1))
            if candi:
                candi.append(pos)
                return candi
        return []

    def pathWithObstacles(self, obstacleGrid: List[List[int]]) -> List[List[int]]:
        self.obstacleGrid = obstacleGrid
        if self.obstacleGrid[0][0]: return []
        return self.func((0, 0))[::-1]


